Training Chastity Lynn-Day 2

Aug 3, 2012 - Performers: Chastity Lynn 


MP4 and WMV + Pics.        


Chastity showed her desire to be trained during her first day, but I want to see just how dedicated she is to the process. I spend the day exploring her and looking for weakness and testing her ability to process pain. She quickly goes into sub-space to cope with what is happening to her physically. I pull her right back and explain to her that she can't learn anything about herself if she 'checks out'. It is essential for her to stay focused on the training, although she would prefer to just take the torment, she is made to embrace it.

